import React from "react";
const Navbar = () => {
  return (
    <nav>
      <ul className="left">
        <li>
          <a href="">MyExpress</a>
        </li>
      </ul>
      <ul className="right">
        <li>
          <a href="">
            <span className="ShoppingCart">
              <i class="fas fa-truck"></i>
              <span className="cartCount">0</span>
            </span>
          </a>
        </li>
      </ul>
    </nav>
  );
};
export default Navbar;
